                p = dict(extra_params)
                p['number'] = s['number']
            cur_extra_params.append(p)
    if is_final:
        partial_info_time = None
        log.info(name, reserve_space=True)
    elif partial_info_time is None or time.time() > partial_info_time + 30:
        partial_info_time = time.time()
